import React, { Component } from 'react'
import Item from '../Item/Item'
import './List.css'

export default class List extends Component {
  render() {
    const {todos} = this.props.todos
    console.log(todos)
    return (
      <div>
        <ul className="todo-main">
          <Item/>
        </ul>
      </div>
    )
  }
}
